import React from 'react';

const ProgressTracker = ({ currentStep }) => {
  const steps = [
    { name: 'Primary Contact', description: 'Contact information for primary person', icon: 'üë§' },
    { name: 'Lead Notifications', description: 'Contact for new patient lead notifications', icon: 'üîî' },
    { name: 'Business Information', description: 'Details about your business and locations', icon: 'üè¢' },
    { name: 'Domain & Google My Business', description: 'Domain and Google account information', icon: 'üåê' },
    { name: 'Logo', description: 'Upload your practice logo', icon: 'üñºÔ∏è' },
    { name: 'Review & Submit', description: 'Review and submit your information', icon: '‚úÖ' },
  ];

  return (
    <nav className="space-y-6">
      {steps.map((step, index) => (
        <div
          key={step.name}
          className={`flex items-start ${
            currentStep === index + 1 ? 'text-white' : 'text-blue-200'
          }`}
        >
          <div className="mr-4 mt-1">
            <div className="w-6 h-6 flex items-center justify-center bg-blue-500 rounded-full text-white text-xs">
              {step.icon}
            </div>
          </div>
          <div>
            <h3 className="font-semibold">{step.name}</h3>
            <p className="text-sm opacity-80">{step.description}</p>
          </div>
        </div>
      ))}
    </nav>
  );
};

export default ProgressTracker;
